import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // For v6
import Login from './Components/Login';
import Signup from './Components/Signup';
import ProfileSetup from './Components/ProfileSetup';
import './App.css';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} /> {/* v6 uses element prop */}
        <Route path="/register" element={<Signup />} />
        <Route path="/:userId/profile-setup" element={<ProfileSetup />} /> {/* Dynamic Route */}
        <Route path="/home" element={<div>Home</div>} />  {/* Blank Home Route */}
      </Routes>
    </Router>
  );
}

export default App;
